2.1 Nyambung ing tingkat meja
Kita wis ndeleng carane Hibernate nyimpen koleksi ing tabel tambahan. Saiki ayo dipikirake carane ngatur hubungan antarane tabel lengkap sing nyimpen kelas Entitas nyata.
Ana papat jinis hubungan antarane kelas Entitas ing Hibernate:
- siji - siji
- siji -kanggo- akeh
- akeh -kanggo- siji
- akeh -kanggo- akeh
Lan kita bakal miwiti analisis kanthi pilihan sing paling gampang - akeh -kanggo- siji .
Sampeyan wis nemokake hubungan kaya ing antarane tabel ing SQL. Iki bi
... 
erasikake obyek (lan referensi obyek) tinimbang id. Dadi pisanan, tinimbang lapangan employeeId ing kelas EmployeeTask, ayo nuding obyek saka jinis Employee. Mangkene tampilan kelas anyar kita:
@Entity
@Table(name="task")
class EmployeeTask {
@Column(name="id")
public Integer id;
@Column(name="name")
public String description;
@ManyToOne
@JoinColumn(name = "employee_id")
public Employee employee;
@Column(name="deadline")
public Date deadline;
}
Kanthi bantuan saka anotasi @ManyToOne
, kita wis n
...
ku sing paling angel. We kudu pass ID direktur, nanging kelas EmployeeTask ora ngemot lapangan ngendi kita bisa nulis id, tinimbang ngemot lapangan Employee ngendi kita kudu nemtokake referensi kanggo obyek saka jinis Employee.
Employee director = session.get(Employee.class, 4);
String hql = "update EmployeeTask set employee = :user where employee is null";
Query  query = session.createQuery(hql, EmployeeTask.class);
query.setParameter("user", director);
query.executeUpdate();
